svg.script:
 function init(evt) {
  function Gear( id, ang, sec){  // gear will rotate angle in secondes
   var g = {};
   g.el = evt.target.ownerDocument.getElementById(id);
   g.angle = 0;  // init
   g.updateAngle = function( date ){
     var s = date.getSeconds() + 60* date.getMinutes() + 3600 * date.getHours();
     g.angle = (s * ang / sec ) % 360;
     g.el.setAttribute("transform", "rotate(" + g.angle + ")");
   };
   return g;
  }

  var gears = [
      Gear("g.sec", 6.0, 1),
      Gear("p.sec", 6.0, 1),

      Gear("g.sec2min", -6 / 7.5, 1),

      Gear("g.min", 6.0 , 60),
      Gear("p.min", 6.0 , 60),

      Gear("g.min2hr", -6.0 / 3, 60),

      Gear("g.hr", 6.0*5, 3600),
      Gear("p.hr", 6.0*5, 3600)
  ];

  function updateGears( gears, date){
    for( var i = 0; i < gears.length; i++){
        var g = gears[i];
        g.updateAngle( date );
    }
  }

  // do update at every new second
  var old_sec = 0;
  var new_sec = 0;
  var date = new Date();
  old_sec = date.getSeconds();

  function everyTimeout( msec ){
    var date = new Date();
    new_sec = date.getSeconds();
    if( old_sec !== new_sec){
      updateGears( gears, date);
      old_sec = new_sec;
    }
    setTimeout(everyTimeout, msec, msec );
  }

  everyTimeout(200);
}
